import './App.css';
import "bootstrap/dist/css/bootstrap.min.css";
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import logo from'./logo/ia.png'
import cloud from'./logo/cloud.png'
function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>
      <main>
        <Container fluid >
           <div class="item1">
            <div>
            <img src={logo}
                 width="180" height="90"></img>
                  <p class="d-inline-block"
                  align="centre">Transcription Tool</p>
            </div>
           </div>
        </Container>
        <Container>
          <div class="wrapper">
          <div class="item3">
           <p> Upload a file</p>
           <box class="upload">
           <img src={cloud}
                class="cloud"></img>
            <div class="upbutton">
            <Button type="button"
            class="btn btn-outline-secondary">Small button</Button>
            </div>
           </box>
            </div>
          </div>
          </Container>
        </main>
    </div>
  );
}

export default App;
